import './App.css';

import React from 'react';
import bayern from './bayern.jpg';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={bayern} className="App-logo" alt="logo" />

      </header>
    </div>
  );
}

export default App;
